Components for entities are stored in a simple map - HashMap<Entity, Component> (see, hobo::storage::SimpleStorage). (This also makes searching for components via hobo::find_one very cheap). Rust's ownership rules ensure that a mutable borrow is exclusive, which means that we cannot have mutable references to components while immutable ones exists (or vice-versa). Here's an example of how this affects hobo: // src\example_file.rs mod example_module { pub use hobo::{prelude::*, create as e}; struct Foo; pub fn test() -> impl hobo::AsElement { e::div() .component(Foo) .with(|&element| { // Ok let foo1 = element.get_cmp::<Foo>(); // Still ok let foo2 = element.get_cmp::<Foo>(); // Panic! let foo3 = element.get_cmp_mut::<Foo>(); }) }
} This, of course, also applies to queries/find/etc. This can be a bit tricky to debug in Wasm, which is why when compiling in debug mode, hobo will display the following helpful message in the browser's console if a borrow-related runtime panic is encountered: panicked at ''already borrowed': Trying to mutably borrow `example_module::Foo` storage at `src\example_file.rs:16:50` while other borrows to it already exist: (mut) src\example_file.rs:16:50 src\example_flib.rs:14:50 src\example_flib.rs:12:50 This will list only the currently active borrows, as well as the mutable one, descending in order of access. (Every type we store as a component will have it's own storage, so it's fine to mutably borrow storages of different types.) As an example of where this could arise as an issue, imagine the following situation: We want to replace an element with a new one, using some data we stored in it. struct SomeData { big_data: u64,
}; pub fn update_element(old_element: impl hobo::AsElement + Copy) { let some_data = old_element.get_cmp::<SomeData>(); let new_element = process_data_and_return_div(some_data); // Runtime panic! old_element.replace_with(new_element);
} This will panic at runtime - this is because when we delete the old element (via replace) we need to mutably borrow the storage to all of it's components, in order to delete them too. However, we are already holding a reference to one of the components. The way to circumvent this would be similar to how one would for any other ownership issue: You can drop the guard, ensuring that no references conflict: pub fn update_element(old_element: impl hobo::AsElement + Copy) { let some_data = old_element.get_cmp::<SomeData>(); let new_element = process_data_and_return_div(some_data); drop(some_data); old_element.replace_with(new_element);
} Or, you can clone the value: #[derive(Clone)]
struct SomeData { big_data: u64,
}; pub fn update_element(element: impl hobo::AsElement + Copy) { let some_data = old_element.get_cmp::<SomeData>().clone(); let new_element = process_data_and_return_div(&some_data); old_element.replace_with(new_element);
}

