} fn get_svg_element(xml_node: &roxmltree::Node, id: u64) -> web_sys::SvgElement { let node: web_sys::SvgElement = wasm_bindgen::JsCast::unchecked_into(document().create_element_ns(Some(wasm_bindgen::intern("http://www.w3.org/2000/svg")), xml_node.tag_name().name()).unwrap()); for attribute in xml_node.attributes() { // need to fixup ids to avoid id collisions in html if the same icon is used multiple times if attribute.name() == "id" { node.set_attribute(wasm_bindgen::intern(attribute.name()), &format!("{}{:x}", attribute.value(), id)).unwrap(); } else { let mut value = attribute.value().to_owned(); // optimistic expectation that ids only used in url references if value.contains("url(#") { value = value.replace(')', &format!("{:x})", id)) } node.set_attribute(wasm_bindgen::intern(attribute.name()), &value).unwrap(); } } for child in xml_node.children().filter(roxmltree::Node::is_element) { node.append_child(&get_svg_element(&child, id)).unwrap(); } node
